import React, { Component } from 'react';
import './squarec.css';

class awal extends Component {

    constructor(props){
        super(props);
        

    }

    render() {
        return (
            <button className="square" onClick={() => alert("click")} >
                {this.props.value}
            </button>
        );
    }
}

export default awal;
